import React from 'react'
import Card from 'react-bootstrap/Card';

const ProductListCard = () => {
  return (
    <Card className='text-center'>
        <Card.Body>
         <div className='mt-3'>
         <h4>No products yet</h4>
         <p cl>Your products will appear here here.Import <br></br> produtcs in minutes and start selling theme <br></br> online and at your location</p>
         </div>
        </Card.Body>
   </Card>
  )
}

export default ProductListCard
